  def test_read_l3v2_empty_lo_2(self):
    reader = libsbml.SBMLReader()
    filename = "../../sbml/sbml/test/test-data/"
    filename += "l3v2-empty-lo-2.xml"
    d = reader.readSBML(filename)
    if (d == None):
      pass    
    self.assertTrue( d.getLevel() == 3 )
    self.assertTrue( d.getVersion() == 2 )
    m = d.getModel()
    self.assertTrue( m != None )
    self.assertTrue( m.getNumUnitDefinitions() == 1 )
    self.assertTrue( m.getNumFunctionDefinitions() == 0 )
    self.assertTrue( m.getNumCompartments() == 0 )
    self.assertTrue( m.getNumSpecies() == 0 )
    self.assertTrue( m.getNumParameters() == 0 )
    self.assertTrue( m.getNumRules() == 0 )
    self.assertTrue( m.getNumInitialAssignments() == 0 )
    self.assertTrue( m.getNumConstraints() == 0 )
    self.assertTrue( m.getNumReactions() == 1 )
    self.assertTrue( m.getNumEvents() == 1 )
    ud = m.getUnitDefinition(0)
    self.assertTrue( ud != None )
    self.assertTrue( ud.getNumUnits() == 0 )
    self.assertTrue( ud.getListOfUnits().hasOptionalAttributes() == True )
    self.assertTrue( ud.getListOfUnits().hasOptionalElements() == False )
    self.assertTrue( ud.getListOfUnits().isSetMetaId() == True )
    self.assertTrue( ud.getListOfUnits().getMetaId() ==  "dd" )
    r = m.getReaction(0)
    self.assertTrue( r != None )
    self.assertTrue( r.getNumReactants() == 0 )
    self.assertTrue( r.getListOfReactants().hasOptionalAttributes() == True )
    self.assertTrue( r.getListOfReactants().hasOptionalElements() == False )
    self.assertTrue( r.getListOfReactants().isSetId() == True )
    self.assertTrue( r.getListOfReactants().getId() ==  "d" )
    self.assertTrue( r.getNumProducts() == 0 )
    self.assertTrue( r.getListOfProducts().isSetName() == True )
    self.assertTrue( r.getListOfProducts().getName() ==  "ss" )
    self.assertTrue( r.getNumModifiers() == 0 )
    self.assertTrue( r.getListOfModifiers().isSetSBOTerm() == True )
    self.assertTrue( r.getListOfModifiers().getSBOTerm() == 2 )
    kl = r.getKineticLaw()
    self.assertTrue( kl != None )
    self.assertTrue( kl.getNumLocalParameters() == 0 )
    self.assertTrue( kl.getListOfLocalParameters().hasOptionalAttributes() == False )
    self.assertTrue( kl.getListOfLocalParameters().hasOptionalElements() == True )
    self.assertTrue( kl.getListOfLocalParameters().isSetNotes() == True )
    self.assertTrue( kl.getListOfLocalParameters().isSetAnnotation() == False )
    e = m.getEvent(0)
    self.assertTrue( e != None )
    self.assertTrue( e.getNumEventAssignments() == 0 )
    self.assertTrue( e.getListOfEventAssignments().hasOptionalAttributes() == False )
    self.assertTrue( e.getListOfEventAssignments().hasOptionalElements() == True )
    self.assertTrue( e.getListOfEventAssignments().isSetNotes() == False )
    self.assertTrue( e.getListOfEventAssignments().isSetAnnotation() == True )
    d = None
    pass  

